import { createRouter, createWebHistory } from "vue-router";
import MapWindow from "../src/components/MapWindow.vue"; // 假设您有三个页面组件 Page1, Page2, Page3
import Data_Sheet from "../src/components/Data_Sheet.vue";
import DispatchWindow from "../src/components/DispatchWindow.vue";
import EnrollWindow from "../src/components/EnrollWindow.vue";
import MainWindow from "../src/components/MainWindow.vue";

const routes = [
  {
    path: "/",
    component: MainWindow,
    children: [
      { path: "map", component: MapWindow },
      { path: "data", component: Data_Sheet },
      { path: "dispatch", component: DispatchWindow },
    ],
  },
  { path: "/enroll", component: EnrollWindow },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
